import { Menu } from 'semantic-ui-react';
import { Link } from '../routes';
export default function Header(){
    return (
        <Menu color = "purple" fixed size = "huge" inverted>
            <Menu.Item>
                CrowdCoin
            </Menu.Item>

            <Menu.Menu position = "right">
                <Menu.Item>
                    Campaigns
                </Menu.Item>
                <Menu.Item>
                    +
                </Menu.Item>
            </Menu.Menu>
        </Menu>
    );
}
